import React from 'react';
import { Link } from "react-router-dom";

import "./squareLink.css";

const SquareLink = ({to = "/", color, text = "", children}) => {
    
    return (
        <div className="square-link">
            <div><Link to={to}  >{children}</Link></div>
            <div>{text}</div>
        </div>
    )
}

export default SquareLink;
